<#
.SYNOPSIS
    Create winpmem and dump RAM
.DESCRIPTION
    Leverage PowerShell to create winpmem and dump RAM in temp directory. File is saved with local timestamp and .zip extension to prevent file name conflict.

    Disclaimer
    This is a sample script and is provided without any warranty. Please test scripts within test environment before using in real incident response scenarios. The author of this script has no affiliations with Microsoft,  the Microsoft Defender for Endpoint (MDE) product, WinPmem, or Velocidex. 
.PARAMETERS
    none
.USAGE
    ram_dump_local_x86.ps1
.VERSION
    1.0
#>

## Check RAM size
$mem_size=(((Get-WmiObject win32_physicalmemory).capacity -as [long]))

## Check for free disk space
$free_space=(((Get-WmiObject win32_logicaldisk -Filter "DeviceID='C:'").freespace -as [long]))

## Create Winpmem in Temp directory
function create_winpmem {
    ## Winpmem variables
    $winpmem_base64=""
    $winpmem_file_path="C:\Windows\Temp\winpmem.exe"

    [IO.File]::WriteAllBytes($winpmem_file_path, [Convert]::FromBase64String($winpmem_base64))
}

## Use created winpmem file to dump RAM into Temp and provides hash of dump
function dump_memory{
    # RAM Dump Directory
    $ram_dump_file ="C:\Windows\Temp\RAM"+(Get-Date -f _yyyy.MM.dd-HH.mm.ss.K | ForEach-Object { $_ -replace ":", "." })+".aff4"

    ## Dump RAM
    cmd.exe /c C:\Windows\Temp\winpmem.exe "$ram_dump_file"

    ## Print file information
    $ram_dump_hash = Get-FileHash $ram_dump_file | Format-List

    Write-Host ""
    Write-Host "System RAM Size (GB):"
    ((Get-WmiObject win32_physicalmemory).capacity -as [long])/1024/1024/1024
    Write-Host ""
    Write-Host "RAM Dump Information:"
    Write-Output $ram_dump_hash
    Write-Host "RAM Dump Size (GB):"
    (Get-Item -Path $ram_dump_file).Length/1GB
}

# Main execution code
if ($free_space -gt $mem_size){
    create_winpmem
    dump_memory
    }
else {
    Write-Host "Not enough free space to dump memory"
}
